    const [passWordAlert, setpassWordAlert] = useState<string>("");
    const userEmail = localStorage.getItem("mail");
    return (

        <Row>
            <Col  className='user-profile-form '>
                        <div className="form">
                            <form className='singup-fields'>
                                <p>{userEmail}</p>
                                <input name='Password' className="input" value={userPassword}
                                    onChange={(event) => setuserPassword(event.target.value)} placeholder='Enter Passsword' type="password" />
